import Vue from "vue";
import VueRouter from "vue-router";
import CommonLayout from "../components/CommonLayout.vue";

Vue.use(VueRouter);

const routes = [
  {
    path: "/",
    name: "home",
    component: CommonLayout,
  },
];

const router = new VueRouter({
  routes,
});

export default router;
